svg.script:
function init(evt)
{
  if ( window.svgDocument == null )
  {
    svgDocument = evt.target.ownerDocument;
  }
}

function colourCountry(country_name, colour)
{
var country = svgDocument.getElementById(country_name);
country.setAttributeNS(null, 'style', 'fill:'+ colour);
}

function displayName(country_name)
{
  svgDocument.getElementById('country_name').firstChild.data = country_name;
}
